import React, { Fragment } from "react";
import GeoLocation from "../src/appContainer/util/geoLocation";
import AppContainer from "../src/appContainer/AppContainer";

const GetGeoLocation = props => {
  console.log("Geo", props);
  return (
    <Fragment>
      <AppContainer lat={props.lat} />
    </Fragment>
  );
};

export default GeoLocation(GetGeoLocation);
